## The Format for a Proxy cache is "admission=[admission Strategy, standart is LCE];eviction=[Eviction Stragegy, Standard is LFU];
# parameterList=[first Parameter determines the size of the cache, after that you can add as many parameters as you want with "," as a delimiter for
# your cache implementation. they will all be passed as strings]" If you want to implement Multiple Caches, the delimiter is a "."
# don't put a "." after the last ReverseProxy setting or it will have a terrible outcome. look in NetworkInformation splitstring why.

#[Config FIFO_LCE_2Proxy]
#Internet.reverseProxyCacheParameters = "admission=LCE;eviction=FIFO;level=1;parameterList=1000000.admission=LCE;eviction=FIFO;level=1;parameterList=1000000"

#When specifying the cache parameters for the ACARC Cache, you after the size is the reduce-rule and then are the subcaches. first type and then the category. The first delimiter has to be the MISC type. 
#[Config ACARC_LCE_2Proxy]
#Internet.reverseProxyCacheParameters = "admission=LCE;eviction=ACARC;level=1;parameterList=20,largestGhostList,LFU,MISC,LRU,Music,LFU,Education.admission=LCE;eviction=ACARC;level=1;parameterList=20,smallestGhostList,LFU,MISC,LRU,Music,LFU,Education"
